// ABSTRACT
abstract contract Calculator {
    function getResult() public virtual returns (uint256);
}

contract Test is Calculator {
    function getResult() pure override public returns (uint256) {
        uint256 a = 4;
        uint256 b = 2;
        uint256 result = a + b;
        return result;
    }
}

